import React, { useState } from "react";
import { Link } from "react-router-dom";

const CadastrarContatoWrap = () => {
  const [formData, setFormData] = useState("");

  // function onChangeHandle(event) {
  //   const { name, value } = event.target;

  //   setFormData({ [name]: value });

  //   console.log(formData);
  // }

  return (
    <div>
        <Link to="/"><button>Home</button></Link>

      <form id="form-cadastro" className="cadastrar-contato">
        <label htmlFor="nome">
          Nome
          <input
            id="nome"
            name="nome"
            type="text"
            onChangeHandle={onChangeHandle}
            required
          />
        </label>

        <label htmlFor="tel">
          Telefone
          <input onChangeHandle={onChangeHandle} id="tel" name="tel" type="tel" required />
        </label>

        <label htmlFor="email">
          Email
          <input onChangeHandle={onChangeHandle} id="email" name="email" type="email" required />
        </label>
        <button type="submit"></button>
      </form>
    </div>
  );
};

export default function CadastrarContato() {
  return <CadastrarContatoWrap />;
}
